import React, { useEffect, useState } from "react";

const Skills = () => {
	const [getSkill, setSkill] = useState([]);
	
	const getSkills = () => {
		try {
			setSkill(
				[
					{
						skill: 'HTML CSS JavaScript',
						caption: 'akjhdkajhd kajshdkjhas jahkhdhs',
						imageLink: './img/skills/html-css-js.svg',
					},
					{
						skill: 'React',
						caption: 'akjhdkajhd kajshdkjhas jahkhdhs',
						imageLink: './img/skills/react.svg',
					},
					{
						skill: 'Tailwind CSS',
						caption: 'akjhdkajhd kajshdkjhas jahkhdhs',
						imageLink: './img/skills/Tailwind_CSS_logo.svg',
					},
					{
						skill: 'HTML CSS JavaScript',
						caption: 'akjhdkajhd kajshdkjhas jahkhdhs',
						imageLink: './img/skills/Bootstrap_logo.svg',
					},
				]
			)
		} catch (error) {
			console.log(error.message);
		}
	}

	useEffect(() => {
		getSkills();
	}, [])

	return (
		<section id="skills">
			<div className="hero min-h-screen bg-base-100">
				<div className="hero-content flex-col lg:flex-row-reverse">
					<img
						src="./img/skils-image.png"
						alt-text="Skill Ilustration"
						className="max-w lg:w-80 rounded-lg"
					/>
					<div>
						<h1 className="text-5xl font-bold">Box Office News!</h1>
						<p className="py-6">
						Provident cupiditate voluptatem et in. Quaerat fugiat ut assumenda
						excepturi exercitationem quasi. In deleniti eaque aut repudiandae
						et a id nisi.
						</p>
						<div className="w-2/3 mx-auto">
							<div className="grid grid-cols-2 gap-4">
								<div>
									<div className="card card-side bg-base-100 border grayscale opacity-60 transition duration-500 hover:grayscale-0 hover:opacity-100">
										<figure>
											<img src="./img/skills/html-css-js.svg" alt="Movie"/>
										</figure>
										<div className="card-body grayscale-0">
											<h2 className="card-title">New movie is released!</h2>
											<p>Click the button to watch on Jetflix app.</p>
										</div>
									</div>
								</div>
								<div className="bg-slate-600 h-32">01</div>
								<div className="bg-slate-600 h-32">01</div>
								<div className="bg-slate-600 h-32">01</div>
								
							</div>
						</div>
					</div>
				</div>
			</div>
		</section>
	);
};

export default Skills;
